import React, { useEffect } from 'react';

import './Start.css';

function Start() {
  useEffect(() => {
    const hamburger = document.querySelector('.header .nav-bar .nav-list .hamburger');
    const mobile_menu = document.querySelector('.header .nav-bar .nav-list ul');
    const menu_item = document.querySelectorAll('.header .nav-bar .nav-list ul li a');
    const header = document.querySelector('.header.container');

    const handleHamburgerClick = () => {
      hamburger.classList.toggle('active');
      mobile_menu.classList.toggle('active');
    };

    const handleScroll = () => {
      const scroll_position = window.scrollY;
      if (scroll_position > 250) {
        header.style.backgroundColor = '#29323c';
      } else {
        header.style.backgroundColor = 'transparent';
      }
    };

    const handleMenuItemClick = () => {
      hamburger.classList.toggle('active');
      mobile_menu.classList.toggle('active');
    };

    hamburger.addEventListener('click', handleHamburgerClick);

    document.addEventListener('scroll', handleScroll);

    menu_item.forEach((item) => {
      item.addEventListener('click', handleMenuItemClick);
    });

    return () => {
      hamburger.removeEventListener('click', handleHamburgerClick);
      document.removeEventListener('scroll', handleScroll);
      menu_item.forEach((item) => {
        item.removeEventListener('click', handleMenuItemClick);
      });
    };
  }, []);

  return (
    <>
      <section id="header">
        <div className="header container">
          <div className="nav-bar">
            <div className="brand">
              <a href="#home">
                <h1><span>V</span>OTE <span>N</span>OW</h1>
              </a>
            </div>
            <div className="nav-list">
              <div className="hamburger">
                <div className="bar"></div>
              </div>
              <ul>
                <li><a href="/" data-after="Home">Home</a></li>
                <li><a href="#services" data-after="Service">Results</a></li>
                <li><a href="#candidates" data-after="Projects">Candidates</a></li>
                <li><a href="#about" data-after="About">About us</a></li>
                <li><a href="#signin" data-after="Signin">Login/Register</a></li>
              </ul>
            </div>
          </div>
        </div>
      </section>

      <section id="Home">
        <div className="Home container">
          <div>
            <h1>Vote, <span></span></h1>
            <h1>For Your Better <span></span></h1>
            <h1>Future <span></span></h1>
            <a href="#about" type="button" className="team">Portfolio</a>
          </div>
        </div>
      </section>

      {/* candidate  */}
      <section id="candidates">
        <div className="candidates container">
          <div className="candidates-header">
            <h1 className="section-title"> Can<span>didates</span></h1>
          </div>
          <div className="all-candidates">
            <div className="project-item">
              <div className="project-info">
                <h1>candidate 1</h1>
                <h2>Coding is Love</h2>
                <p>???????</p>
              </div>
              <div className="project-img">
                <img src={''} alt="img" />
              </div>
            </div>
            {/* ... (similar blocks for candidate 2, 3, 4, 5) ... */}
          </div>
        </div>
      </section>
      {/* candidate  */}

      <section id="services">
        <div className="services container">
          <div className="service-top">
            <h1 className="section-title">Re<span>su</span>lts</h1>
            <p>???????</p>
